import React, { useEffect, useState } from 'react';
import { useHistory, useParams } from 'react-router-dom';
import { fetchCountryMedals } from '../api/countryAPI';
import { Container, Col, Card, Row } from 'react-bootstrap';
import { COUNTRIES_ROUTE } from '../utils/consts';
import { containerStyle, NavBar } from '../components/NavBar';

const CountryPage = () => {
    const [country, setCountry] = useState(null);
    const { name } = useParams();
    const history = useHistory();


    const i1 = {
        color: "white",
        border: '3px solid white',
        width: '300px',
        height:'60px',
        borderRadius: '20px',
        backgroundColor:"rgba(255, 255, 255, 0.29)",
        cursor: "pointer",
        padding:'0px',
        marginTop:'10px',
        marginBottom:'10px'
    };

    const flag1 = {
        marginLeft:"135px",
    };

    const table1 = {
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center',
        marginTop: '20px',
        width: '200%',
    };

    const tab1 = {
        padding:'0px',
        marginLeft:'50px',
        marginTop:'50px'
    }

    const tableRow1 = {
        display: 'flex',
        margin:'0px',
        justifyContent: 'center',
        alignItems: 'center',
        width: '100%',
    };

    const tableChild2 = {
        padding:"0px 5px 20px 5px",
        textAlign: 'center',
        border: "1px solid white",
        borderTop:"0px",
        margin:"0px",
    };

    const go = {
        padding:"20px 20.485px 0px 20.485px",
        textAlign: 'center',
        border: "1px solid white",
        borderBottom:"0px",
    }

    const si = {
        padding:"20px 24.405px 0px 24.405px",
        textAlign: 'center',
        border: "1px solid white",
        borderBottom:"0px",
    }

    const b = {
        padding:"20px 32.335px 0px 32.335px",
        textAlign: 'center',
        border: "1px solid white",
        borderBottom:"0px",
    }

    const t = {
        padding:"20px 22.515px 0px 22.515px",
        textAlign: 'center',
        border: "1px solid white",
        borderBottom:"0px",
    }

    const medal = {
        marginLeft:"10px",
        width:"40px"
    }

    useEffect(() => {
        fetchCountryMedals(name)
            .then(data => setCountry(data))
            .catch(error => console.error(error));
    }, [name]);

    const handleMedalClick = (name,medalType) => {
        history.push(COUNTRIES_ROUTE + `/${name}/${medalType}` );
    };

    if (!country) {
        return <div>Loading...</div>;
    }

    return (
        <Container className="containerStyle">
            <NavBar/>
            <Col className='p-0'>
            <h1 className="h1">{country.name}</h1>
            <img className="flag" src={`/images/flags/${country.name.replace(' ', '')}.png`} alt={country.name} />
            </Col>
            <Col className="table">
                <Row className="tableRow">
                    <h5 className="tableChild2">GOLD</h5>
                    <h5 className="tableChild2">SILVER</h5>
                    <h5 className="tableChild2">BRONZE</h5>
                    <h5 className="tableChild2">TOTAL</h5>
                </Row >
                <Row className="tableRow">
                    <h5 className="go">{country.medals.gold}</h5>
                    <h5 className="si">{country.medals.silver}</h5>
                    <h5 className="b">{country.medals.bronze}</h5>
                    <h5 className="t">{country.medals.gold + country.medals.silver + country.medals.bronze}</h5>
                </Row >
            </Col>


            <Col className="tab">
                <Col md={4}>
                    <Card onClick={() => handleMedalClick(country.name,'gold')} className="i">
                        <h5><img className="medal" src='/images/medals/gold.png' alt='gold'></img>Medals</h5>
                    </Card>
                </Col>
                <Col md={4}>
                    <Card onClick={() => handleMedalClick(country.name,'silver')}  className="i">
                        <h5><img className="medal" src='/images/medals/silver.png' alt='silver'></img>Medals</h5>
                    </Card>
                </Col>
                <Col md={4}>
                    <Card onClick={() => handleMedalClick(country.name,'bronze')} className="i">
                        <h5><img className="medal" src='/images/medals/bronze.png' alt='bronze'></img>Medals</h5>
                    </Card>
                </Col>
            </Col>
        </Container>
    );
};

export default CountryPage;
